import React from 'react'
import JobCard from './JobCard';


function JobPostingsList() {
    const jobPostings = [
        {
          title: "Frontend Developer",
          company: "XYZ Tech Solutions",
          location: "New York, NY",
          salary: "$70,000 - $90,000 per year",
        },
        {
          title: "Backend Developer",
          company: "ABC Software",
          location: "San Francisco, CA",
          salary: "$80,000 - $100,000 per year",
        },
        {
          title: "UI/UX Designer",
          company: "Design Co.",
          location: "Seattle, WA",
          salary: "$60,000 - $80,000 per year",
        },
        {
          title: "Data Analyst",
          company: "Data Insights",
          location: "Chicago, IL",
          salary: "$65,000 - $85,000 per year",
        },
        {
          title: "Mobile App Developer",
          company: "Mobile Solutions Ltd.",
          location: "London, UK",
          salary: "£50,000 - £70,000 per year",
        },
        {
          title: "Software Engineer",
          company: "Tech Innovations",
          location: "Austin, TX",
          salary: "$75,000 - $95,000 per year",
        },
        {
          title: "Product Manager",
          company: "Productive Corp.",
          location: "Toronto, Canada",
          salary: "CAD 80,000 - CAD 100,000 per year",
        },
        {
          title: "DevOps Engineer",
          company: "Cloud Solutions",
          location: "Berlin, Germany",
          salary: "€65,000 - €85,000 per year",
        },
        {
          title: "Full Stack Developer",
          company: "Tech Wizards",
          location: "Sydney, Australia",
          salary: "AUD 90,000 - AUD 110,000 per year",
        },
        {
          title: "Data Scientist",
          company: "Data Insights",
          location: "Singapore",
          salary: "SGD 70,000 - SGD 90,000 per year",
        },
      ];
      
  return (
    <div>
      {jobPostings.map((jobPosting, index) => (
        <JobCard key={index} jobPosting={jobPosting} />
      ))}
    </div>
  )
}

export default JobPostingsList
